import React, { useState } from "react";
import EditIcon from "@mui/icons-material/Edit";

function FullNote(props) {
  return (
    <div className="view">
      <div className="view-p">
        <h2 contentEditable="true" className="view-h2">
          {props.head1}
        </h2>
        <p contentEditable="true" className="vie">
          {props.body1}
        </p>
      </div>
      <div className="bnts">
        <button onClick={props.chNote} className="view-close" type="button">
          close
        </button>
        <button onClick={props.chNote} className="edit" type="button">
          <EditIcon></EditIcon>
        </button>
      </div>
    </div>
  );
}

export default FullNote;
